// src/App.jsx
import React from "react";
import { Routes, Route } from "react-router-dom";
import Layout from "./pages/Layout";
import Home from "./pages/Home";
import Catalog from "./pages/Catalog";       // create this page if not exist
import CarDetail from "./pages/CarDetail";   // create placeholder if needed
import SellPage from "./pages/SellPage";     // create placeholder if needed
import About from "./pages/About";           // optional
import NotFound from "./pages/NotFound";     // create placeholder if needed

export default function App() {
  return (
    <Routes>
      {/* public layout wraps these pages (Topbar/Subnav/Footer inside Layout) */}
      <Route path="/" element={<Layout />}>
        <Route index element={<Home />} />
        <Route path="catalog" element={<Catalog />} />
        <Route path="cars/:id" element={<CarDetail />} />
        <Route path="sell" element={<SellPage />} />
        <Route path="about" element={<About />} />
        <Route path="*" element={<NotFound />} />
      </Route>
    </Routes>
  );
}
